description:
Take Command is a comprehensive interactive GUI and Windows command line toolkit that makes your Windows command prompts easier to use and far more powerful. Take Command includes optional Explorer-style integration, tabbed console windows, major enhancements to standard Windows CMD commands such as COPY, DEL, and MOVE, and adds 150+ new commands, vastly improved command line editing and tab filename completion, and thousands of other features.

In addition, Take Command is a powerful batch file programming tool, offering extensions such as DO loops, error and exception handling, block-structured logic, an integrated IDE with a sophisticated editor and batch debugger, third-party plugins, and more than 550 built-in variables and functions.

